-- Volcando estructura para procedimiento facturacion_plasencia.buscar_producto
DELIMITER //
CREATE PROCEDURE `buscar_producto`(
	IN `todo` VARCHAR(50)
)
BEGIN

if  todo = "" then 

 SELECT clase_productos.id_producto,capa_productos.capa,clase_productos.item,clase_productos.codigo_producto,clase_productos.codigo_caja,clase_productos.codigo_precio,
 clase_productos.presentacion,cellos.cello,cellos.anillo, cellos.upc,marca_productos.marca, nombre_productos.nombre, vitola_productos.vitola,tipo_empaques.tipo_empaque, clase_productos.sampler, clase_productos.descripcion_sampler AS des
FROM clase_productos ,marca_productos,vitola_productos,tipo_empaques,nombre_productos, capa_productos, cellos
WHERE  clase_productos.id_vitola = vitola_productos.id_vitola AND clase_productos.id_capa = capa_productos.id_capa and
 clase_productos.id_nombre = nombre_productos.id_nombre AND  cellos.id_cello =clase_productos.id_cello and clase_productos.id_marca = marca_productos.id_marca  AND
   clase_productos.id_tipo_empaque = tipo_empaques.id_tipo_empaque ;

ELSE

SELECT x.id_producto, x.item,x.marca,x.nombre, x.vitola,x.tipo_empaque, x.capa, x.anillo, x.upc, x.cello, x.presentacion,x.codigo_precio,x.codigo_caja,x.codigo_productos, x.sampler, x.des
from(SELECT clase_productos.id_producto AS id_producto ,clase_productos.item AS item,marca_productos.marca AS marca, nombre_productos.nombre AS nombre, 
 vitola_productos.vitola AS vitola,tipo_empaques.tipo_empaque AS tipo_empaque ,capa_productos.capa AS capa, clase_productos.sampler AS sampler, clase_productos.descripcion_sampler AS des,
 clase_productos.presentacion AS presentacion,cellos.cello AS cello,cellos.anillo as anillo, cellos.upc AS upc,clase_productos.codigo_producto AS codigo_productos,clase_productos.codigo_caja AS codigo_caja,clase_productos.codigo_precio AS codigo_precio
FROM clase_productos ,marca_productos,vitola_productos,tipo_empaques,nombre_productos, cellos, capa_productos
WHERE  clase_productos.id_vitola = vitola_productos.id_vitola AND clase_productos.id_capa = capa_productos.id_capa AND  cellos.id_cello =clase_productos.id_cello AND 
clase_productos.id_nombre = nombre_productos.id_nombre AND  clase_productos.id_marca = marca_productos.id_marca  AND 
clase_productos.id_tipo_empaque = tipo_empaques.id_tipo_empaque )x
 where x.nombre LIKE  CONCAT("%",todo,"%") || x.marca LIKE  CONCAT("%",todo,"%")
|| x.item LIKE  CONCAT("%",todo,"%") || x.vitola LIKE  CONCAT("%",todo,"%");



END if;

END//
DELIMITER ;

